        this.handleChange = this.handleChange.bind(this);
    }
      
    handleChange(event) {
        this.setState({value: event.target.value});
    }

    render(){
        return (
            <label>
                Deadline:
                <input className='date-picker' type = "date" defaultValue = {this.date} value = {this.date} onChange = {this.handleChange}/>
                
                <button onClick={console.log(date)}></button>
            </label>
        )
    }
}
